import React from "react";
import "./Hero.css";

function Hero() {
  return (
    <section className="hero-section">
      <div className="hero-overlay">
        <h2>YEAR OVER YEAR. KNOWLEDGE SHARED. LEGACIES BUILT.</h2>
        <h3>ONYX 81</h3>
        <div className="tagline">STRONGER TOGETHER</div>
        <p>Asset Library Promo Video</p>
        <small>An extension of our community</small>
        <div className="video-length">02:05</div>
      </div>

      {/* Embed Video from Google Drive */}
      <div className="video-container">
        <iframe
          src="https://drive.google.com/file/d/1T7eRGQunajY8dGZZ4qhyxiVbpHeqlWbU/preview"
          width="100%"
          height="315"
          frameBorder="0"
          allow="autoplay; encrypted-media"
          allowFullScreen
        ></iframe>
      </div>
    </section>
  );
}

export default Hero;
